got a call just days before the show. got flown in, learned the show, and then performed… this was the most unexpected blessing. 

this was a chance for me to show myself i am capable and that anything that is meant for me will not miss me and man… what an incredible experience this was. 

@parrisgoebel thank you for trusting me and giving this girl a chance to live her dream. thank you for allowing me to be apart of something so iconic and inspiring. 

@gab.robert @nat_bat_ thank you for helping me so much and making sure i felt comfortable and ready for stage. @teesha.siale @islapotini thank you both for getting me together!!! staying up late & giving alllllll the details! @alekzsamone @amvndamay y’all already know. love y’all to death and wouldn’t have wanted to do it with anyone else. @alainiwalker you are incredible. @monyettc i’m so glad we got to perform together my love.
thank you to everyone else on the cast for helping me out and being the best!!!

